# Heuristic function
# Hscore = estimated movement cost from start to end, neglecting walls
def heuristic(a, b):
    return np.sqrt((b[0] - a[0]) ** 2 + (b[1] - a[1]) ** 2)

# Main pathfinding fuction
def astar(array, start, goal):
    neighbors = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    close_set = set()  # closed list
    came_from = {}  # contains parent position
    gscore = {start: 0}  # Movement cost from start to goal
    fscore = {start: heuristic(start, goal)}
    oheap = []  # open list
    heapq.heappush(oheap, (fscore[start], start))  # Pushing onto open list
    while oheap:
        current = heapq.heappop(oheap)[1]  # call smallest Fscore and its position
        if current == goal:  # when goal reached, return its path
            data = []
            while current in came_from:
                data.append(current)
                current = came_from[current]
            return data

        close_set.add(current)  # add the current position to closed list

        for i, j in neighbors:
            neighbor = current[0] + i, current[1] + j
            tentative_g_score = gscore[current] + heuristic(current, neighbor)  # Calculate gscore for all neighbors
            if 0 <= neighbor[0] < array.shape[0]:  # Ignore neighbors out of bound
                if 0 <= neighbor[1] < array.shape[1]:
                    if array[neighbor[0]][neighbor[1]] == 1:
                        continue
                else:
                    # array bound y walls
                    continue
            else:
                # array bound x walls
                continue

            if neighbor in close_set and tentative_g_score >= gscore.get(neighbor,0):  # Ignore already in closed and gscore bigger
                continue

            if tentative_g_score < gscore.get(neighbor, 0) or neighbor not in [i[1] for i in oheap]:  # gscore less or not in open, add
                came_from[neighbor] = current
                gscore[neighbor] = tentative_g_score
                fscore[neighbor] = tentative_g_score + heuristic(neighbor, goal)
                heapq.heappush(oheap, (fscore[neighbor], neighbor))

